import React from 'react';
import './Playlist.css';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Tracklist from '../TrackList/TrackList';
import Paper from '@mui/material/Paper'; // Import Paper component

function Playlist() {
  return (
    <Paper className="playlist" elevation={0} sx={{ backgroundColor: 'rgba(255, 255, 255, 0.2)' }}>
      <h1 className="playlist-title">My Playlist</h1>
      <Tracklist />
      <TextField 
        fullWidth 
        size="small" 
        label="New Playlist" 
        variant="outlined" 
        sx={{ marginBottom: 2, backgroundColor: 'rgba(255, 255, 255, 0.3)' }} // More visible TextField
      />
      <Button 
        variant="contained" 
        color="primary"
        sx={{ marginY: 2 }}
      >
        SAVE TO SPOTIFY
      </Button>
    </Paper>
  );
}

export default Playlist;
